import React, {Component} from 'react';
import { Route, Redirect } from 'react-router-dom';
import { isLogged } from './UserFunctions';
const PrivateRoute = ({ component: Component, ...rest }) => (
<Route
{...rest}
render={props =>
isLogged ? (
<Component {...props} />
) : (
<Redirect
to={{
pathname: "/login"
}}
/>
)
}
/>
);
export default PrivateRoute;
